find-process-mode: strict
enable-process: true
profile:
  store-selected: true
  store-fake-ip: true
  tracing: true
interface-name: ""
keep-alive-interval: 15 
experimental:
  quic-go-disable-gso: false
  quic-go-disable-ecn: false
  dialer-ip4p-convert: true
sniffer:
  enable: true
  sniffing:
    - tls
    - http
  skip-domain:
    - 'Mijia Cloud'
    - 'dlg.io.mi.com'
    - '+.apple.com'
    - '*.baidu.com'
  force-domain:
    - '+'
    - '+.google.com'
  port-whitelist:
    - 80
    - 443
    - 8000-9000


